import React from "react";
import "./MainHeader.css";
function MainHeader() {
  return (
    <div className="header-section">
      <img src="path-to-your-image" alt="Robin" className="profile-pic" />
      <h1>I'm Shuohe Ren</h1>
      <h2>
        I am a software engineer, and i have been coding for over 10 years!
      </h2>
    </div>
  );
}
export default MainHeader;
